impl Solution {
    pub fn count_subarrays(nums: Vec<i32>, k: i32) -> i64 {
        let mut ans = 0i64;
        let n = nums.len();
        let mut left = 0;
        let mut right = 0;
        let mut freq = std::collections::HashMap::new();
        while right < n {
            *freq.entry(nums[right]).or_insert(0) += 1;
            while *freq.get(&nums[right]).unwrap() < k {
                right += 1;
                if right == n {
                    break;
                }
                *freq.entry(nums[right]).or_insert(0) += 1;
            }
            if right == n {
                break;
            }
            let mut temp_right = right + 1;
            while temp_right < n && !freq.contains_key(&nums[temp_right]) {
                temp_right += 1;
            }
            ans += (temp_right - right) as i64;
            if *freq.get(&nums[left]).unwrap() == k {
                let mut temp_left = left + 1;
                while temp_left <= right && nums[temp_left] != nums[right] {
                    temp_left += 1;
                }
                ans += ((temp_right - right) * (temp_left - left)) as i64;
                left = temp_left + 1;
            } else {
                left += 1;
            }
            if left > right {
                right = left;
            }
            if left == n || right == n {
                break;
            }
            freq.clear();
            for i in left..=right {
                *freq.entry(nums[i]).or_insert(0) += 1;
            }
        }
        ans
    }
}
